export default class Wishlist {
    constructor(
        wid,
        username,
        moviecd,
        movienm,
        posterurln,
        raiting,
        opendt
    ) {
        this.wid = wid;
        this.username = username;
        this.moviecd = moviecd;
        this.movienm = movienm;
        this.posterurln = posterurln;
        this.raiting = raiting;
        this.opendt = opendt;
    }
}
